import React from 'react';
import { MDBInput, MDBFormInline} from 'mdbreact';

class Home extends React.Component {
  constructor(props) {
    super(props);
    this.state = {
    };
  }

  render() {
    return (
      <div className="mb-4" style={{ marginTop: '70px' }}>

        <h2 className="h1-responsive text-center my-4">Order management</h2>

        <MDBFormInline>
          <div class="form-row col-12" style={{ border: '' }}>
            <div className='col-1'>
              <label style={{ fontWeight: 'bold', marginRight: '2px' }}>Order:</label>
            </div>
            <MDBInput label="Id" outline disabled/>
            <MDBInput label="Source" outline />
            <MDBInput label="Status" outline />
            <MDBInput label="Tracking Id" outline />
            <MDBInput label="Total" outline disabled/>
          </div>
          <div class="form-row col-12" style={{ border: '' }}>
            <div className='col-1'>
              <label style={{ fontWeight: 'bold', marginRight: '2px' }}>Customer:</label>
            </div>
            <MDBInput label="Name" outline />
            <MDBInput label="Contact" outline />
            <MDBInput label="Address" outline />
            <MDBInput label="Total value added" outline disabled/>
          </div>
          <div class="form-row col-12" style={{ border: '' }}>
            <div className='col-1'>
              <label style={{ fontWeight: 'bold', marginRight: '2px' }}>Product:</label>
            </div>
            <MDBInput type='text' label="Name" outline />
            <MDBInput type='text' label="SKU" outline />
            <MDBInput type='number' label="Rate" outline />
            <MDBInput type='number' label="Id." outline />
            <MDBInput type='number' label="Id." outline />
            <MDBInput type='number' label="Id." outline />
            <MDBInput style={{marginLeft:'5px'}} type='checkbox' filled label='Is Extra added?' />


          </div>
          </MDBFormInline>

      </div>
    );
  }
}

export default Home;
